function correct(s){
  let n=s.match(/(\(\))/g).length
  for(let i of r[n]){
    let c=0,x=s
    while(c<n)x=x.replace(/(\(\))/,i[c++])
    if(eval(x.replace(/=/,'=='))){
        let c=0,x=s
        while(c<n)x=x.replace(/(\(\))/,`(${i[c++]})`)
        return x
    }
  }
}

